    "summary": "Pasta With Wild Mushrooms, Peas and Bacon requires approximately <b>approximately 45 minutes</b> from start to finish. For <b>$8.21 per serving</b>, this recipe <b>covers 52%</b> of your daily requirements of vitamins and minerals. This recipe makes 2 servings with <b>2436 calories</b>, <b>53g of protein</b>, and <b>88g of fat</b> each. Only a few people really liked this main course. 8 people have made this recipe and would make it again. It is brought to you by Foodista. If you have garlic, olive oil, shallot, and a few other ingredients on hand, you can make it. All things considered, we decided this recipe <b>deserves a spoonacular score of 82%</b>. This score is outstanding. Try <a href=\"https://spoonacular.com/recipes/penne-with-chicken-wild-mushrooms-and-peas-349197\">Penne with Chicken, Wild Mushrooms and Peas</a>, <a href=\"https://spoonacular.com/recipes/creamy-buckwheat-pasta-with-wild-mushrooms-76442\">Creamy Buckwheat Pasta with Wild Mushrooms</a>, and <a href=\"https://spoonacular.com/recipes/wild-rice-with-bacon-mushrooms-green-onions-665344\">Wild Rice With Bacon, Mushrooms & Green Onions</a> for similar recipes.",
