    "summary": "Baked Caramel Custard might be just the dessert you are searching for. This gluten free recipe serves 6 and costs <b>76 cents per serving</b>. One serving contains <b>251 calories</b>, <b>12g of protein</b>, and <b>1g of fat</b>. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. This recipe from Foodista has 46 fans. If you have port wine, egg yolk, evaporated skim milk, and a few other ingredients on hand, you can make it. All things considered, we decided this recipe <b>deserves a spoonacular score of 61%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/mexican-flan-baked-caramel-custard-141402\">Mexican Flan (Baked caramel Custard)</a>, <a href=\"https://spoonacular.com/recipes/caramel-custard-pots-with-salted-caramel-sauce-497733\">Caramel Custard Pots with Salted Caramel Sauce</a>, and <a href=\"https://spoonacular.com/recipes/caramel-custard-228774\">Caramel Custard</a> for similar recipes.",
