    "summary": "Black Bean Brownies might be just the <b>American</b> recipe you are searching for. For <b>53 cents per serving</b>, this recipe <b>covers 7%</b> of your daily requirements of vitamins and minerals. This recipe serves 12. One serving contains <b>233 calories</b>, <b>5g of protein</b>, and <b>12g of fat</b>. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. It is brought to you by Foodista. 156 people have made this recipe and would make it again. Head to the store and pick up black beans, egg yolk, flour, and a few other things to make it today. All things considered, we decided this recipe <b>deserves a spoonacular score of 28%</b>. This score is not so amazing. Similar recipes are <a href=\"https://spoonacular.com/recipes/amazing-black-forest-black-bean-brownies-508256\">AMAZING BLACK FOREST BLACK BEAN BROWNIES</a>, <a href=\"https://spoonacular.com/recipes/black-bean-brownies-555499\">Black Bean Brownies</a>, and <a href=\"https://spoonacular.com/recipes/black-bean-brownies-814946\">Black Bean Brownies</a>.",
