    "summary": "Curried Cabbage & Kale Gratin requires approximately <b>approximately 45 minutes</b> from start to finish. One portion of this dish contains about <b>13g of protein</b>, <b>17g of fat</b>, and a total of <b>278 calories</b>. This recipe serves 8 and costs $1.26 per serving. This recipe from Foodista has 15 fans. It works well as an affordable side dish. A mixture of garlic, eggs, butter, and a handful of other ingredients are all it takes to make this recipe so delicious. Taking all factors into account, this recipe <b>earns a spoonacular score of 64%</b>, which is good. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/kale-and-cabbage-gratin-203118\">Kale and Cabbage Gratin</a>, <a href=\"https://spoonacular.com/recipes/curried-cauliflower-gratin-641063\">Curried Cauliflower Gratin</a>, and <a href=\"https://spoonacular.com/recipes/curried-sweet-potato-gratin-172592\">Curried Sweet Potato Gratin</a>.",
