    "instructions": "<ol><li>Strain spinach and squeeze through a cheesecloth to remove as much liquid as possible.</li><li>In heavy saucepan over medium heat, saute garlic and onions in butter until golden, about 3-5 minutes. Stir in flour and cook for 1 minute.</li><li>Slowly whisk in cream and stock and continue cooking until boiling.</li><li>Once boiling, stir in lemon juice, hot sauce, salt and Romano cheese; stir until cheese has melted.</li><li>Remove from heat and allow to cool for 5 minutes.</li><li>Stir in sour cream, then fold in dry spinach and artichoke hearts.</li><li>Pour in large ovenproof/microwave proof dish. Or smaller ramekins (as shown.) Sprinkle cheddar evenly on top.</li><li>Heat in microwave or bake in oven until cheese on top is melted.</li><li>Serve hot with tortilla chips, sour cream and salsa for dipping.</li></ol>",
