    "imageType": "jpg",
    "summary": "This recipe makes 16 servings with <b>200 calories</b>, <b>3g of protein</b>, and <b>10g of fat</b> each. For <b>54 cents per serving</b>, this recipe <b>covers 4%</b> of your daily requirements of vitamins and minerals. From preparation to the plate, this recipe takes around <b>45 minutes</b>. 17 people were impressed by this recipe. A mixture of frangelico, ground allspice, powdered sugar, and a handful of other ingredients are all it takes to make this recipe so tasty. It is a good option if you're following a <b>vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 20%</b>. This score is rather bad. Similar recipes include <a href=\"https://spoonacular.com/recipes/naturally-sweet-honey-blondies-909220\">Naturally Sweet Honey Blondies</a>, <a href=\"https://spoonacular.com/recipes/yam-or-sweet-potato-casserole-naturally-gluten-free-692138\">Yam or Sweet Potato Casserole (Naturally Gluten Free)</a>, and <a href=\"https://spoonacular.com/recipes/sweet-potato-turnovers-with-sweet-kraut-188944\">Sweet Potato Turnovers with Sweet Kraut</a>.",
