    "id": 646491,
    "title": "Healthy Mint Brownies",
    "readyInMinutes": 45,
    "servings": 12,
    "sourceUrl": "http://www.foodista.com/recipe/JTC6D6KV/healthy-mint-brownies",
    "summary": "The recipe Healthy Mint Brownies could satisfy your American craving in around <b>45 minutes</b>. This recipe makes 12 servings with <b>241 calories</b>, <b>5g of protein</b>, and <b>12g of fat</b> each. For <b>$1.03 per serving</b>, this recipe <b>covers 9%</b> of your daily requirements of vitamins and minerals. If you have cocoa powder, ground flax, jar pear, and a few other ingredients on hand, you can make it. 24 people were impressed by this recipe. All things considered, we decided this recipe <b>deserves a spoonacular score of 41%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/mint-brownies-122695\">Mint Brownies</a>, <a href=\"https://spoonacular.com/recipes/mint-dip-with-brownies-415999\">Mint Dip with Brownies</a>, and <a href=\"https://spoonacular.com/recipes/mint-brownies-505791\">Mint Brownies</a> for similar recipes.",
    "cuisines": [
    "American"
    ],
    "dishTypes": [
    "side dish"
    ],
    "diets": [ ],
    "occasions": [ ],
    "instructions": "<ol><li>Directions:</li><li>Preheat the oven to 350 degrees. Line a 9 by 9 or 7 by 11 baking sheet with parchment paper and set aside.</li><li>Combine the flax, applesauce and almond milk together in a small bowl. Set aside to allow to thicken. In a food processor, combine the blueberries, pear, black beans and oil. Pulse until the mixture become very smooth. Next, add the extracts and process until fully combined. Remove the contents from processor into a medium sized mixing bowl. Add the coconut sugar, cocoa, baking powder, soda, and salt and mix. Add the flour with the chocolate chips and mix until just combined. Pour the batter into your prepared dish and bake at 350 for 44-45 minutes.</li><li>Remove from the oven and allow to cool for at least 50 minutes. If you would like, place the brownies in the fridge for 20 or 30 minutes to speed up cooling time. While the brownies cool, start on your mint filling.</li><li>In a small bowl, combine the soft avocado with full fat coconut milk or heavy cream. Beat on high for about 5 minutes until the mixture is fluffy and smooth. Add the powdered xylitol and mix well. Add peppermint extract and coloring if desired, and beat until all incorporated. Once the mixture is perfectly fluffy and creamy, add the flour and mix until just combined. The mixture should be thick and smooth but still easy to spread. Spread the mixture evenly over the cooled brownies and place in the fridge for 10 minutes, until the mint filling has firmed.</li><li>Next, melt the chocolate. Add the oil to the melted chocolate and stir to combine. Remove the brownies from the fridge and pour the melted chocolate over the brownies, gently and quickly spread the chocolate evenly over the brownies. The mint filling should be cold so the warm chocolate doesnt melt the mint filling, but the chocolate will cool quickly once it touches the cold mint. Make sure to work quickly so the chocolate layer will be even. Return the brownies to the fridge to cool for another 5 minutes until the chocolate is set.</li><li>Cut the brownies after the 5 minutes with a sharp knife. Serve brownies chilled or at room temperature. Store any left overs in an airtight container in the refrigerator.</li><li>NOTE: Once the chocolate layer has firmed, be sure to cut all the brownies immediately with a sharp knife. I cut some of the brownies when they were really, really cold, and they didnt cut clean and pretty.</li><li>*For those who are not concerned with gluten content, wheat or white flour would work okay as well. For wheat, decrease the amount by 1 tablespoon. For the filling, be sure to use a white color flour to keep the mint filling a bright pretty green color.</li><li>**You can use any kind of chocolate you like, but dark chocolate gives a wonderful flavor to the peppermint and sugar free dark chocolate is the easiest to find.</li></ol>",
