    "summary": "Cinnamon Mocha Quick Bread might be just the breakfast you are searching for. One serving contains <b>315 calories</b>, <b>5g of protein</b>, and <b>9g of fat</b>. For <b>24 cents per serving</b>, this recipe <b>covers 7%</b> of your daily requirements of vitamins and minerals. This recipe serves 16. If you have buttermilk, eggs, ground cinnamon, and a few other ingredients on hand, you can make it. This recipe from Foodista has 37 fans. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. With a spoonacular <b>score of 27%</b>, this dish is rather bad. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/cinnamon-swirl-quick-bread-405233\">Cinnamon Swirl Quick Bread</a>, <a href=\"https://spoonacular.com/recipes/apple-cinnamon-quick-bread-206136\">Apple Cinnamon Quick Bread</a>, and <a href=\"https://spoonacular.com/recipes/cinnamon-raisin-quick-bread-403545\">Cinnamon Raisin Quick Bread</a>.",
