    "summary": "Chicken Piccata With Angel Hair Pasta might be just the main course you are searching for. For <b>$2.5 per serving</b>, this recipe <b>covers 28%</b> of your daily requirements of vitamins and minerals. One serving contains <b>742 calories</b>, <b>27g of protein</b>, and <b>30g of fat</b>. From preparation to the plate, this recipe takes around <b>45 minutes</b>. This recipe is liked by 60 foodies and cooks. Head to the store and pick up basil, lemon zest, roma tomatoes, and a few other things to make it today. To use up the olive oil you could follow this main course with the <a href=\"https://spoonacular.com/recipes/sauteed-banana-granola-and-yogurt-parfait-624619\">Sauteed Banana, Granolan and Yogurt Parfait</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 87%</b>. This score is awesome. Try <a href=\"https://spoonacular.com/recipes/scallop-piccata-on-angel-hair-696769\">Scallop Piccatan on Angel Hair</a>, <a href=\"https://spoonacular.com/recipes/angel-hair-pasta-with-chicken-398894\">Angel Hair Pasta with Chicken</a>, and <a href=\"https://spoonacular.com/recipes/chicken-and-angel-hair-pasta-136399\">Chicken and Angel Hair Pasta</a> for similar recipes.",
