    "summary": "One Bowl Jalapeno Cheddar Cornbread could be just the <b>lacto ovo vegetarian</b> recipe you've been looking for. One portion of this dish contains around <b>13g of protein</b>, <b>26g of fat</b>, and a total of <b>527 calories</b>. For <b>76 cents per serving</b>, you get a bread that serves 6. 36 people were impressed by this recipe. It is an <b>inexpensive</b> recipe for fans of Southern food. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. If you have flour, sugar, buttermilk, and a few other ingredients on hand, you can make it. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 42%</b>. This score is solid. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/jalapeno-cheddar-cornbread-558111\">Jalapeno Cheddar Cornbread</a>, <a href=\"https://spoonacular.com/recipes/jalapeo-cheddar-cornbread-587899\">Jalapeño Cheddar Cornbread</a>, and <a href=\"https://spoonacular.com/recipes/jalapeno-cheddar-cornbread-744726\">Jalapeno Cheddar Cornbread</a>.",
