    "instructions": "<p><b><i>Step 1:</i></b> With the aid of a sifter, sift the dry ingredients (flour, baking powder, salt, nutmeg) into a bowl and set aside.<br><b><i>Step 2:</i></b> Grease the cake pan and dust with flour. Also pre-heat oven to 180 degrees Celsius<br><b><i>Step 3:</i></b> Put the butter, sugar and yogurt into a mixer or bowl {if you are using hand mixer}, mix until fluffy; mix on a high speed.<br><b><i>Step 4:</i></b> Crack in the eggs, one at a time…mix for about a minute before adding next. Then add the vanilla extract and mix.<br><b><i>Step 5:</i></b> Add the flour in batches; reduce the speed to the lowest and mixed. Once the flour is combined <b>(doesn’t have to be perfect)</b>, and then stop; so you don’t over work the batter.<br><b><i>Step 6:</i></b> At this point, add the milk and mix with a spatula until combined.<br><b><i>Step 7:</i></b> Pour batter into the greased cake pan and bake for approximately 50 minutes or until golden brown.</p>",
