    "summary": "You can never have too many main course recipes, so give Steamed Clams In Wine and Chorizo a try. For <b>$3.05 per serving</b>, this recipe <b>covers 23%</b> of your daily requirements of vitamins and minerals. One serving contains <b>558 calories</b>, <b>26g of protein</b>, and <b>37g of fat</b>. From preparation to the plate, this recipe takes around <b>45 minutes</b>. Head to the store and pick up onion, cilantro, garlic clove, and a few other things to make it today. To use up the olive oil you could follow this main course with the <a href=\"https://spoonacular.com/recipes/sauteed-banana-granola-and-yogurt-parfait-624619\">Sauteed Banana, Granolan and Yogurt Parfait</a> as a dessert. A few people made this recipe, and 14 would say it hit the spot. It is a good option if you're following a <b>caveman, gluten free, dairy free, and primal</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 65%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/steamed-clams-in-wine-and-chorizo-185479\">Steamed Clams in Wine and Chorizo</a>, <a href=\"https://spoonacular.com/recipes/the-secret-ingredient-chorizo-chorizo-steamed-mussels-and-clams-with-white-beans-76765\">The Secret Ingredient (Chorizo): Chorizo-Steamed Mussels and Clams with White Beans</a>, and <a href=\"https://spoonacular.com/recipes/steamed-clams-with-chorizo-oil-609051\">Steamed Clams with Chorizo Oil</a> for similar recipes.",
