    "instructions": "In a large skillet over medium heat, cook sausage until no longer pink; about 10 minutes. Drain fat and set aside.\nIn the same skillet melt 1 tablespoon of butter. Add shallots, garlic, celery, apple and mushrooms and saut until tender. Sprinkle with thyme and sage.\nPour white wine over vegetables and de-glaze the pan. Saut for another 2 minutes to cook off the alcohol.\nIn a large bowl, combine sausage, vegetable mixture,  2 tablespoons of butter, and bread. Pour chicken broth over stuffing, stirring well to evenly coat the bread pieces. You want the bread to be moist but not soggy.\nPlace stuffing in a 913 inch casserole dish and cover with foil. Bake for 20 minutes and remove foil.\nDot the top with remaining 1 tablespoon of butter and bake uncovered for an additional 10 minutes until the top has browned.\nServe immediately",
