    "imageType": "jpg",
    "summary": "The recipe Bananas Foster Ice Cream could satisfy your Cajun craving in approximately <b>roughly 45 minutes</b>. This recipe serves 2 and costs $5.39 per serving. This dessert has <b>1757 calories</b>, <b>17g of protein</b>, and <b>137g of fat</b> per serving. This recipe from Foodista requires milk, kosher salt, granulated sugar, and brown sugar. It is perfect for <b>Summer</b>. It is a good option if you're following a <b>gluten free and lacto ovo vegetarian</b> diet. 22 people were glad they tried this recipe. Taking all factors into account, this recipe <b>earns a spoonacular score of 55%</b>, which is good. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/bananas-foster-with-ice-cream-166685\">Bananas Foster with Ice Cream</a>, <a href=\"https://spoonacular.com/recipes/bananas-foster-ice-cream-570890\">Bananas Foster Ice Cream</a>, and <a href=\"https://spoonacular.com/recipes/bananas-foster-ice-cream-pastry-81089\">Bananas Foster Ice-Cream Pastry</a>.",
