    "summary": "The recipe Mango Fried Rice could satisfy your Chinese craving in roughly <b>45 minutes</b>. This recipe makes 2 servings with <b>485 calories</b>, <b>16g of protein</b>, and <b>4g of fat</b> each. For <b>$1.49 per serving</b>, this recipe <b>covers 19%</b> of your daily requirements of vitamins and minerals. It is a good option if you're following a <b>gluten free, dairy free, and vegetarian</b> diet. 262 people have made this recipe and would make it again. A mixture of chicken stock, mango, vegetables, and a handful of other ingredients are all it takes to make this recipe so flavorful. To use up the rice you could follow this main course with the <a href=\"https://spoonacular.com/recipes/rice-pudding-245761\">Rice Pudding</a> as a dessert. It works well as a reasonably priced main course. All things considered, we decided this recipe <b>deserves a spoonacular score of 97%</b>. This score is tremendous. Try <a href=\"https://spoonacular.com/recipes/mango-pork-fried-rice-176007\">Mango-Pork Fried Rice</a>, <a href=\"https://spoonacular.com/recipes/thai-chicken-and-mango-fried-rice-509300\">Thai Chicken and Mango Fried Rice</a>, and <a href=\"https://spoonacular.com/recipes/veg-fried-rice-how-to-make-vegetable-fried-rice-rice-s-487457\">veg fried rice , how to make vegetable fried rice | rice s</a> for similar recipes.",
