    "summary": "Savory Radicchio and Prosciutto Crostini Topped with Sweet Syrupy Sapa might be just the hor d'oeuvre you are searching for. One serving contains <b>125 calories</b>, <b>5g of protein</b>, and <b>4g of fat</b>. For <b>$1.33 per serving</b>, this recipe <b>covers 11%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista has 19 fans. If you have glugs of olive oil, salt & pepper, if unavailable, and a few other ingredients on hand, you can make it. This recipe is typical of Mediterranean cuisine. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 54%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/crostini-of-radicchio-prosciutto-and-sapa-18755\">Crostini Of Radicchio, Prosciutto And Sapa</a>, <a href=\"https://spoonacular.com/recipes/sweet-pea-crostini-with-prosciutto-517601\">Sweet Pea Crostini with Prosciutto</a>, and <a href=\"https://spoonacular.com/recipes/bluestems-crostini-with-prosciutto-and-hot-and-sweet-cipollini-195951\">Bluestem's Crostini with Prosciutto and Hot and Sweet Cipollini</a> for similar recipes.",
