    "summary": "Sweet and Sticky Chicken Strips might be just the main course you are searching for. One serving contains <b>819 calories</b>, <b>32g of protein</b>, and <b>27g of fat</b>. For <b>$2.03 per serving</b>, this recipe <b>covers 25%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 5551 foodies and cooks. From preparation to the plate, this recipe takes approximately <b>32 minutes</b>. If you have panko bread crumbs, ground cayenne pepper, garlic powder, and a few other ingredients on hand, you can make it. To use up the flour you could follow this main course with the <a href=\"https://spoonacular.com/recipes/apple-tart-with-caramel-sauce-47961\">Apple Tart with Caramel Sauce</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 79%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/sweet-sticky-honey-soy-sauce-chicken-strips-627472\">Sweet & Sticky Honey Soy Sauce Chicken Strips</a>, <a href=\"https://spoonacular.com/recipes/chicken-strips-with-sweet-and-sour-sauce-143899\">Chicken Strips with Sweet and Sour Sauce</a>, and <a href=\"https://spoonacular.com/recipes/general-tsos-sweet-chili-chicken-strips-554481\">General Tso’s Sweet Chili Chicken Strips</a> for similar recipes.",
