    "summary": "Fall Fruit Compote might be just the sauce you are searching for. This recipe makes 8 servings with <b>131 calories</b>, <b>1g of protein</b>, and <b>3g of fat</b> each. For <b>68 cents per serving</b>, this recipe <b>covers 2%</b> of your daily requirements of vitamins and minerals. It can be enjoyed any time, but it is especially good for <b>Autumn</b>. If you have apple cider vinegar, cinnamon stick, cherries, and a few other ingredients on hand, you can make it. 7 people have made this recipe and would make it again. It is a good option if you're following a <b>gluten free and vegetarian</b> diet. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 12%</b>. This score is not so amazing. Try <a href=\"https://spoonacular.com/recipes/fall-fruit-compote-57602\">Fall Fruit Compote</a>, <a href=\"https://spoonacular.com/recipes/sunday-brunch-fall-fruit-compote-50308\">Sunday Brunch: Fall Fruit Compote</a>, and <a href=\"https://spoonacular.com/recipes/angel-food-cake-with-fall-fruit-compote-59222\">Angel Food Cake with Fall Fruit Compote</a> for similar recipes.",
