    "imageType": "jpg",
    "summary": "Need a <b>lacto ovo vegetarian morn meal</b>? Easy Homemade Apple Fritters could be a spectacular recipe to try. For <b>16 cents per serving</b>, this recipe <b>covers 3%</b> of your daily requirements of vitamins and minerals. This recipe makes 12 servings with <b>149 calories</b>, <b>2g of protein</b>, and <b>1g of fat</b> each. Head to the store and pick up cinnamon, milk, salt, and a few other things to make it today. 1335 people were glad they tried this recipe. It is brought to you by recipe-of-today.blogspot.com. From preparation to the plate, this recipe takes around <b>30 minutes</b>. With a spoonacular <b>score of 65%</b>, this dish is solid. Try <a href=\"https://spoonacular.com/recipes/easy-homemade-apple-sauce-676445\">Easy Homemade Apple Sauce</a>, <a href=\"https://spoonacular.com/recipes/easy-homemade-apple-pie-filling-924524\">Easy Homemade Apple Pie Filling</a>, and <a href=\"https://spoonacular.com/recipes/easy-homemade-apple-oat-muesli-506904\">Easy Homemade Apple & Oat Muesli</a> for similar recipes.",
