    "summary": "Spinach and Gorgonzola Stuffed Flank Steak might be a good recipe to expand your main course recipe box. This recipe makes 4 servings with <b>523 calories</b>, <b>47g of protein</b>, and <b>28g of fat</b> each. For <b>$4.21 per serving</b>, this recipe <b>covers 39%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista has 9 fans. <b>valentin day</b> will be even more special with this recipe. If you have salt and pepper, spinach, shallot, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 95%</b>. This score is outstanding. Similar recipes include <a href=\"https://spoonacular.com/recipes/bruce-aidells-spinach-and-gorgonzola-stuffed-flank-steak-202812\">Bruce Aidells' Spinach and Gorgonzola-Stuffed Flank Steak</a>, <a href=\"https://spoonacular.com/recipes/spinach-stuffed-flank-steak-19875\">Spinach-stuffed Flank Steak</a>, and <a href=\"https://spoonacular.com/recipes/spinach-feta-stuffed-flank-steak-446715\">Spinach & Feta Stuffed Flank Steak</a>.",
