    "image": "https://spoonacular.com/recipeImages/651757-556x370.jpg",
    "imageType": "jpg",
    "summary": "One serving contains <b>557 calories</b>, <b>10g of protein</b>, and <b>42g of fat</b>. For <b>$1.69 per serving</b>, this recipe <b>covers 9%</b> of your daily requirements of vitamins and minerals. From preparation to the plate, this recipe takes around <b>45 minutes</b>. This recipe from Foodista has 31 fans. A mixture of salt, eggs, cream, and a handful of other ingredients are all it takes to make this recipe so delicious. All things considered, we decided this recipe <b>deserves a spoonacular score of 33%</b>. This score is not so amazing. Try <a href=\"https://spoonacular.com/recipes/meyer-lemon-cheesecake-586206\">Meyer Lemon Cheesecake</a>, <a href=\"https://spoonacular.com/recipes/meyer-lemon-cheesecake-559460\">Meyer Lemon Cheesecake</a>, and <a href=\"https://spoonacular.com/recipes/meyer-lemon-cheesecake-487232\">Meyer Lemon Cheesecake</a> for similar recipes.",
    "cuisines": [ ],
    "dishTypes": [
    "side dish"
    ],
    "diets": [ ],
    "occasions": [ ],
    "instructions": "<ol><li>1. Preheat oven to 300 degrees.</li><li>2. Combine gingersnaps and melted butter in a Ninja Blender or food processor and run until gingersnaps are crumbly. Press mixture firmly into the bottom of two 6 Springform pans coated with cooking spray. Bake for 15 minutes; cool on a wire rack.</li><li>3. To prepare the filling, using an electric mixer, beat the cream cheese until smooth. Add the sugar then the salt. Beat in the eggs, 1 at a time. Next add the sour cream, lemon juice and zest. Beat until thoroughly mixed. (Make sure you get the cream cheese mixed in from the bottom of the mixing bowl.)</li><li>4. Pour the filling into the two Springform pans. Do not fill to the very top as the mixture expands a little bit. If you have a small amount of mixture left over just bake it in a small baking dish.</li><li>5. Fill an 11x13 (approx.) with water on a lower rack in the oven. On the middle rack, above the water pan, place the two Springform pans. Place in 300* oven for 1 hour and 10 minutes. After 35 minutes, reverse the position of the two pans if they are in two different areas of the oven, such as one in front of the other.</li><li>6. Turn the oven off and leave the cheesecakes in the oven for another hour.  Remove from oven and cool to room temperature on a wire rack.</li><li>7. When cheesecakes are at room temperature, place them in the refrigerator for 8 hours or overnight.</li><li>8. Before removing from pan, use a knife to cut around the pan sides. Then open the clasp on the Springform and release the cheesecake. Place it on a serving plate with the bottom of the Springform pan underneath.</li></ol>",
